import React, { lazy, Suspense } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
// import { QueryClient, QueryClientProvider} from "react-query";
import './App.css';
// layout 
// import { ReactQueryDevtools } from 'react-query/devtools';
import 'antd/dist/antd.css'
// components 
import LayoutPattern from './components/layout/LayoutPattern'
import LoginPage from './components/utility_pages/LoginPage'
import FileUpload from './components/utility_pages/FileUpload'
const Dashboard = lazy(()=> import('./components/dashboard/Dashboard'))
const EmailedList = lazy(()=> import('./components/emailedList/EmailedList'))
// const EmailStage = lazy(()=> import('./components/emailStage/EmailStage'))
const Connections = lazy(()=> import('./components/connections/Connections'))

const App = ()=> {

  // const queryClient = new QueryClient({
  //   defaultOptions: {
  //     queries: {
  //       suspense: true,
  //     },
  //   },
  // })

  return (
    <div className="App">
      <Router>  
      <Suspense fallback={(<div className="lds-hourglass">Waiting</div>)}> 
        <Switch>
            {/* <QueryClientProvider client={queryClient}> */}
              <Route exact path='/' component={LoginPage} />
              <LayoutPattern>
                <Route exact path='/dashboard' component={Dashboard} layout={LayoutPattern}/>
                <Route exact path='/emailed_list' component={EmailedList} layout={LayoutPattern}/>
                {/* <Route exact path='/email_stage' component={EmailStage} layout={LayoutPattern}/> */}
                <Route exact path='/connections' component={Connections} layout={LayoutPattern}/>
                <Route exact path='/file_upload' component={FileUpload} layout={LayoutPattern}/>
              </LayoutPattern>
              {/* <Route exact path='/ingredients' component={IngredientsList} />
              <Route exact path='/ingredients-detail/:ingredient' component={IngredientDetail} /> */}
              {/* <ReactQueryDevtools initialIsOpen={false} /> */}
            {/* </QueryClientProvider> */}
        </Switch>
      </Suspense>
    </Router>
    </div>
  );
}

export default App;
